**Is your feature request related to a problem? Please describe.**
I'm using lightgbm classifier exported onnx model  pred in java runtime.
my onnx model included missing value imputer , but I have no idea how to create a tensor with missing values.

when using Float[][]  createTensor throw exception as below, however, float[][] works.
my question is when using float[][], I can't set missing values as null or something else....

please help.

exception :
ai.onnxruntime.OrtException: Cannot create an OnnxTensor from a base type of class java.lang.Float
	at ai.onnxruntime.TensorInfo.constructFromJavaArray(TensorInfo.java:232)
	at ai.onnxruntime.OnnxTensor.createTensor(OnnxTensor.java:337)
	at ai.onnxruntime.OnnxTensor.createTensor(OnnxTensor.java:321)

code snap as below:
            for (Map.Entry<String, Float[]> kv : floatFeature.entrySet()) {
                String feaName = kv.getKey();
                Float[] feaValues = kv.getValue();
                Float[][] feaValues2d = new Float[feaValues.length][1];
                for (int i = 0; i < feaValues.length; i++) {
